#include <bits/stdc++.h>

using namespace std;

using ll = long long;

vector<int> convert(const string &s) {
	ll y{};
	for (char c : s) {
		int x = c - '0' - (c >= 'a' ? 8 : c >= 'A' ? 2 : 0);
		y = 70 * y + x;
	}
	vector<int> A(23);
	for (int i = 0; i < 13; ++i) {
		A[i] = 2 * (i + 1);
	}
	vector<int> B(19);
	for (int i = 0; i < 19; ++i) {
		B[i] = 2 * i + 1;
	}
	for (int i = 22; i > 12; --i) {
		A[i] = y % (32 - i);
		y /= 32 - i;
	}
	for (int i = 13; i < 23; ++i) {
		int x = A[i];
		A[i] = B[x];
		B.erase(B.begin() + x);
	}
	return A;
}

int eval(vector<int> &A) {
	static vector<int> dp(40);
	fill(dp.begin(), dp.end(), 0);
	for (int i = 0; i < A.size(); ++i) {
		dp[A[i]] = accumulate(dp.begin(), dp.begin() + A[i], 1);
	}
	return accumulate(dp.begin(), dp.end(), 0);
}

